import React from "react";
import { Briefcase, ClipboardList, BarChart, Calendar } from "lucide-react";

export default function WorkCard() {
  return (
    <div className="bg-[#fafafa] shadow-md rounded-xl p-6 flex justify-between items-center">
      <div>
        <h2 className="uppercase tracking-widest text-xs mb-3 text-gray-500">â€” Work</h2>
        <ul className="space-y-2 text-gray-700 text-sm">
          <li className="flex items-center gap-2"><Briefcase size={16}/> Projects</li>
          <li className="flex items-center gap-2"><ClipboardList size={16}/> Tasks</li>
          <li className="flex items-center gap-2"><BarChart size={16}/> Reports</li>
          <li className="flex items-center gap-2"><Calendar size={16}/> Meetings</li>
        </ul>
      </div>
      <div className="bg-gray-100 rounded-full w-20 h-20 flex items-center justify-center text-xs font-serif text-gray-600">
        WORK
      </div>
    </div>
  );
}
